gbg(){return"\u0b15\u0b3e\u0b30\u0b4d\u0b21\u0b17\u0b41\u0b5c\u0b3f\u0b15"},
giy(){return"\u0b17\u0b4b\u0b32\u0b3e\u0b15\u0b3e\u0b30 \u0b15\u0b4b\u0b23 \u0b25\u0b3f\u0b2c\u0b3e \u0b2c\u0b47\u0b38\u0b32\u0b3e\u0b07\u0b28 \u0b15\u0b3e\u0b30\u0b4d\u0b21\u0b17\u0b41\u0b5c\u0b3f\u0b15"},
